    const { description, value } = this.props;
    return (
      <form>
        <label htmlFor="valueInput">
          Valor:
          <input
            data-testid="value-input"
            name="value"
            onChange={ handleChange }
            type="number"
            value={ value }
          />
        </label>

        <label htmlFor="description">
          Descrição:
          <input
            data-testid="description-input"
            name="description"
            onChange={ handleChange }
            type="text"
            value={ description }
          />
        </label>

        <label htmlFor="currenciesInput">
          Moeda
          <input
            data-testid="currencies-input"
            type="s"
            value={ value }
          />
        </label>
      </form>
    );
  }
}

Form.propTypes = {
  currencies: Proptypes.arrayOf(Proptypes.any),

}.isRequired;

export default connect()(Form);
